import React, { useState } from "react";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
} from "reactstrap";
import { connect } from "react-redux";
import { logout } from "../../store/actions/authActions";
import SignedInLinks from "./SignedInLinks";
import SignedOutLinks from "./SignedOutLinks";
import { withRouter, NavLink as RRNavLink } from "react-router-dom";
const NavBar = (props) => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

  const accesoDasboard = props.user && props.user.acceso[0].dashboard;
  const accesoMisTarjetas = props.user && props.user.acceso[0].tarjetas;
  console.log(props);
  return (
    <div>
      <Navbar color="light" light expand="md">
        <NavbarBrand href="/">Administrador de tarjetas</NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          <Nav className="mr-auto" navbar>
            {accesoDasboard ? (
              <NavItem>
                <NavLink to="/" activeClassName="active" tag={RRNavLink}>
                  Dashboard
                </NavLink>
              </NavItem>
            ) : null}

            {accesoMisTarjetas ? (
              <NavItem>
                <NavLink
                  to="/tarjetas"
                  activeClassName="active"
                  tag={RRNavLink}
                >
                  Mis Tarjetas
                </NavLink>
              </NavItem>
            ) : null}
          </Nav>
          <Nav className="ml-auto" navbar>
            <NavItem onClick={props.logout}>
              <NavLink to="/login">Salir</NavLink>
            </NavItem>
          </Nav>
        </Collapse>
      </Navbar>
    </div>
  );
};

const mapStateToProps = (state) => ({
  user: state.auth.user,
  isAuthenticated: state.auth.isAuthenticated,
});
export default connect(mapStateToProps, { logout })(withRouter(NavBar));
